import React from "react";
import brand from "../../../../Assets/img/brand.png";
import {NavLink} from "react-router-dom";

interface IProps{

}

let Navbar : React.FC<IProps> = () => {
    return(
        <React.Fragment>
           <nav className = "navbar navbar-dark bg-dark navbar-expand-sm">
               <div className = "container">
                   <div className = "navbar-brand">
                   <img src={brand} alt="" width="130" height="30" />
                   </div>
                   <button className="navbar-toggler" data-bs-target="#nav" data-bs-toggle="collapse">
                       <span className="navbar-toggler-icon"></span>
                   </button>
                   <div className="collapse navbar-collapse" id = "nav">
                       <ul className="navbar-nav">
                           <li className="nav-item">
                               <NavLink className="nav-link font-weight-bold" to="/products/men">Mens Collection</NavLink>
                           </li>
                       </ul>
                   </div>
               </div>
           </nav>
        </React.Fragment>
    )
}

export default Navbar;
